result:
.routeinstall {
  width: 100%;
  height: calc(100vh - 80px);
  padding: 1%;
  background: #f0f3ff;
  overflow: hidden;
}
.map {
  width: 100%;
  height: 100%;
}
.leftdiv {
  width: 300px;
  height: 95.5%;
  position: absolute;
  background: #fff;
  z-index: 1;
}
.leftdiv_list {
  width: 70%;
  margin: auto;
  margin-top: 2%;
  font-size: 1.2vh;
  overflow: hidden;
  height: 7vh;
  line-height: 5vh;
  cursor: pointer;
}
.leftdiv_list .elselect {
  float: right;
  width: 75%;
}
.leftdiv_list table {
  background: #eff1f2;
}
.leftdiv_list tr {
  background: #fff;
}
.leftdiv_list th {
  background: #eff1f2;
}
.leftdiv_list td,
th {
  width: 33%;
  text-align: center;
  margin: 0;
  border-top: 1px solid #EFF1F2;
  border-left: 1px solid #EFF1F2;
  border-right: 1px solid #EFF1F2;
  /* border:  */
}
.leftdiv_list .el-input--medium {
  width: 75%;
  height: 50%;
  font-size: 10px;
  float: right;
}
.el-input__inner {
  height: 100%;
  width: 100%;
}
.leftdiv_list .datainp {
  width: 100%;
  height: 100%;
  border: 0;
}
.dian {
  float: right;
  margin-right: 10px;
  cursor: pointer;
  vertical-align: middle;
  margin-top: 5%;
}
.zhogn {
  background: #c5d6ff;
}
.zhogn td {
  background: #c5d6ff;
}
.btn {
  width: 30%;
  height: 3vh;
  background: linear-gradient(
    90deg,
    rgba(63, 106, 255, 1) 0%,
    rgba(109, 142, 255, 1) 100%
  );
  box-shadow: 0px 0px 11px 0px rgba(63, 106, 255, 0.28);
  border-radius: 2vh;
  text-align: center;
  font-size: 1vh;
  line-height: 3vh;
  color: #fff;
  float: left;
  margin-left: 10%;
}
.btn2 {
  width: 30%;
  height: 3vh;
  background: #fff;
  border: 1px solid rgba(63, 106, 255, 1);
  box-shadow: 0px 3px 8px 0px rgba(63, 106, 255, 0.3);
  border-radius: 2vh;
  text-align: center;
  font-size: 1vh;
  line-height: 3vh;
  color: #3f6aff;
  float: left;
  margin-left: 10%;
}
.tank{
  width: 100px;
  height: 50px;
  background: #fff
}
